import { configureStore } from "@reduxjs/toolkit";
import navbarSlice from './reducers/navbarSlice';
import searchSlice from './reducers/searchSlice';
const Store = configureStore({
    reducer:{
        navbar:navbarSlice,
        search:searchSlice
    }
});

export default Store;
